import React from 'react'

class ActionButton extends React.Component {
   constructor(){
      super();
   }

   buttonAction(){
      // console.log('hello');
      <Link to="/shop" />
   }

   render(){
      return (
         <button id={this.props.id} onClick={this.buttonAction()}>
            {this.props.name}
         </button>
      )
   }
}

export default ActionButton
